   const [testy1,stt1]=useState(false);
   const [testy2,stt2]=useState(false);
   const [testy3,stt3]=useState(false);
   const [testy4,stt4]=useState(false);
   const [testy5,stt5]=useState(false);
   const [testy6,stt6]=useState(false);
